import React from 'react';
import Subgenre from './Subgenre/Subgenre';


class SubgenreList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            id: '',
            name: ''
        }
    }

    load = () => {
        console.log('subs', this.props.subgenres);
        if (typeof stringify(this.props.subgenres) != 'undefined') {
            for (var sub in this.props.subgenres) {
                if (this.props.subgenres.hasOwnProperty(sub)) {
                    console.log('kid', sub);
                    console.log('plz', this.props.subgenres[sub].name);
                    let id = sub;
                    let name = this.props.subgenres[sub].name;
                    // let array = [];
                    // array.push(this.props.subgenres[sub].id);
                    // array.push(this.props.subgenres[sub].name);
                    // console.log('dfdfd', array);
                    // result.push(array);
                    // console.log('bitchyes', result);
                    return [id, name];
                }
            }
        }
    }

    

    render() {
        let multiArray = this.load();
        let [id, name] = multiArray; 
        return (
                <li>
                    {
                        <Subgenre 
                            key={id}
                            id={id}
                            name={name}
                        />
                        
                    }
                </li>
            )    
    }                
    
}

export default SubgenreList;
